import React from 'react';
import '../Vehicle/Vehicle.css';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

function Vehicle({ vehicles }) {
  const history = useNavigate();

  const deleteHandler = async (id) => {
    await axios.delete(`http://localhost:5000/vehicles/${id}`)
      .then(() => history("/"))
      .then(() => history("/vehicledetails"));
  };

  return (
    <div className='vehicleTable'>
      <table border={1} cellPadding={10} cellSpacing={0}>
        <thead>
          <tr>
            <th>ID</th>
            <th>VIN</th>
            <th>Reg.No</th>
            <th>Make</th>
            <th>Model</th>
            <th>Year</th>
            <th>Owner Name</th>
            <th>Owner NIC</th>
            <th>Owner Email</th>
            <th>Owner Address</th>
            <th>Contact Number</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {vehicles && vehicles.map(vehicle => (
            <tr key={vehicle._id}>
              <td>{vehicle._id}</td>
              <td>{vehicle.vin}</td>
              <td>{vehicle.regNo}</td>
              <td>{vehicle.make}</td>
              <td>{vehicle.model}</td>
              <td>{vehicle.year}</td>
              <td>{vehicle.ownerName}</td>
              <td>{vehicle.ownerNic}</td>
              <td>{vehicle.ownerEmail}</td>
              <td>{vehicle.ownerAddress}</td>
              <td>{vehicle.contactNo}</td>
              <td className='actionButtons'>
                <Link to={`/vehicledetails/${vehicle._id}`}>Update</Link>
                <button onClick={() => deleteHandler(vehicle._id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
export default Vehicle;
